#include "repository.h"
#include <assert.h>
#include <string>
#include <iostream>
#include <fstream>
#include <algorithm>

repository::repository(const std::string& fN)
{
    dog d1("Skipper","ChowChow",2,"data:image/jpeg;base64,");
    dog d2("Doge","Chihuahua",5,"data:image/jpeg;base64,");
    dog d3("Tia","Dogue",3,"data:image/jpeg;base64,");
    dog d4("Pepper","Dogue",3,"data:image/jpeg;base64,");
    dog d5("Pugga","Pug",4,"data:image/jpeg;base64,");
    this->addDog(d1);
    this->addDog(d2);
    this->addDog(d4);
    this->addDog(d3);
    this->addDog(d5);
    this->fileName = fN;
    //this->readFromFile();
}

void repository::readFromFile() {
    std::ifstream file(this->fileName.c_str());
    if(file.bad()) return;
    file.open(this->fileName.c_str());
    std::string n,b,l;
    int a;
    while(file.good()) {
        assert(false);
        file>>n>>b>>a>>l;
        dog d(n,b,a,l);
        this->addDog(d);
    }
    file.close();
}

void repository::saveToFile() {
    std::string line = "";
    std::ofstream file(this->fileName.c_str());
    if(file.bad()) return;
    for(unsigned int i = 0;i<dogs.size();i++) {
        dog d = dogs[i];
        file<<d.getName()<<" "<<d.getBreed()<<" "<<d.getAge()<<" "<<d.getLink()<<std::endl;
    }
    file.close();
}

bool repository::foundDog(const std::string &name, const std::string &breed) {
    for(unsigned int i = 0;i<dogs.size();i++) {
        dog d = dogs[i];
        if(d.getName()==name && d.getBreed()==breed) {
            return true;
        }
    }
    return false;
}

void repository::addDog(const dog &d) {
    if(!this->foundDog(d.getName(),d.getBreed())) {
        dogs.push_back(d);
    }
}

void repository::removeDog(const dog &remD) {
    dogVector aux;
    for(unsigned int i = 0;i<dogs.size();i++) {
         dog d = dogs[i];
         if(!(d==remD)) aux.push_back(d);
     }
    dogs = aux;
}

dogVector repository::findByBreedAndAge(const std::string &breed, int age) {
    dogVector aux;
    for(unsigned int i = 0;i<dogs.size();i++) {
         dog d = dogs[i];
         if(d.getAge()==age && d.getBreed()==breed) aux.push_back(d);
     }
    return aux;
}
